export default (function(a,b,c,d,e,f,g,h){return {data:{s9dkzn7pCi:{data:{id:430,attributes:{imdbId:"tt0043361",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDZhZWYxNzAtODA3Yi00MDk3LWFiNmItZDhjMmQxZmY1OTk3XkEyXkFqcGdeQXVyNTk1MTk0MDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.3\u002F10"}],item_lang:{data:{id:1093,attributes:{title:"Bright Victory",plot:"In North Africa during World War II, Sergeant Larry Nevins is blinded by a German sniper's bullet. Rehabilitation at the military hospital presents many challenges, but accepting his disability also proves to be difficult for others.",slug:"bright-victory"}}},books:{data:[{id:3513,attributes:{title:"Baynard Kendrick Lights Out",description:a,thumbnail:a,authors:[b],firstBook:true,published:"1945-01-01",publisher:a,subtitle:a}},{id:3514,attributes:{title:"Lights Out",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1948-01-01",publisher:"Collins",subtitle:a}},{id:3515,attributes:{title:"Lights Out. Bright Victory, Etc",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1953-01-01",publisher:a,subtitle:a}},{id:3516,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:c,published:g,publisher:h,subtitle:a}},{id:3517,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:c,published:g,publisher:h,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940932359}}("","Baynard Kendrick",null,"Out of Control","Murder disrupts a blind PI’s honeymoon in this mix of detective novel and psychological thriller from the author of Death Knell. The wife of a wealthy Tennessee mining tycoon, Marcia Fillmore has worked hard to get to where she is in life. She’s also a woman with a dark past, one she’s put behind her . . . until a man walks into the Black Pigeon in Gatlinburg and takes a seat beside her at the bar. Marcia doesn’t take kindly to him threatening her with blackmail, following her home—or seeing her kiss a man who isn’t her husband. Everything could fall apart. No, something must be done . . . A former intelligence officer in the army, Capt. Duncan Maclain lost his sight in World War I. Since then, he’s honed his other senses and become a successful private detective whose unique skills are sought after frequently. So it’s no surprise when he arrives in the Smoky Mountains with his new bride and the sheriff asks him for help investigating a suspicious car wreck. With evidence that points to foul play, the sheriff and Maclain know they’ve got a killer to catch—but she’s not going to go down without a fight . . . “Ingenious.” —Kirkus Reviews “The most completely evil and yet interesting woman you’ve read about in a long time . . . Superlative!” —Chicago Daily News Baynard Kendrick was the first American to enlist in the Canadian Army during World War I. While in London, he met a blind English soldier whose observational skills inspired the character of Capt. Duncan Maclain. Kendrick was also a founding member of the Mystery Writers of America and winner of the organization’s Grand Master Award.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tugREAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2021-03-09","Open Road Media"))